    { id: 23, title: "Machine 23", description: "This is the fourth card.", image:  Pic23 },
    { id: 24, title: "Machine 24", description: "This is the fourth card.", image:  Pic24 },
  ];

  const navigate = useNavigate();

    const handleContact = () => {
        navigate("/contactus"); // Navigate using a route, NOT a file path
    };


  return (
    <>

<PageHeader topheading="Embossing Seals " title="embossingseal"/> 
       
       
    <div className="container">
      <div className="cards-container">
      <div className="container">
        <div className="row mb-2">
        </div>
      </div>
        
        
        
        
        
        
        
        
        
        
        
        
        
        
        
        
         {data.map((item) => (
        <div key={item.id} className="card">
          <img src={item.image} alt={item.title} className="card-image" />
          <div className="card-content">
            <h3>{item.title}</h3>
            <p>{item.description}</p>
            {/* <button className="card-button" >Details</button> */}
            <button 
            onClick={handleContact} 
            className='card-button'
        >
        Details
        </button>
          </div>
         </div>
          ))}
      </div>
    </div>
    </>
  )
}












